// ==UserScript==
// @name         YouTube — return normal sidebar layout
// @version      666.There were some problems with what you posted…You updated the code but didn't increase the @version number. Those who previously installed your script may not get the updated code. Save anyway
// @description  Horizontální layout karet v pravém sidebaru, možná skryje in‑feed reklamy, možná funguje i s alternativními renderery a možná lazy‑loadem.
// @author       Copilot :)
// @license MIT
// @match        https://www.youtube.com/*
// @run-at       document-start
// @noframes
// @grant        GM_addStyle
// @icon         data:image/png;base64,
// @namespace    https://violentmonkey.github.io
// @downloadURL https://update.greasyfork.org/scripts/555993/YouTube%20%E2%80%94%20return%20normal%20sidebar%20layout.user.js
// @updateURL https://update.greasyfork.org/scripts/555993/YouTube%20%E2%80%94%20return%20normal%20sidebar%20layout.meta.js
// ==/UserScript==

(function () {
  'use strict';

  // CSS jen pro pravý panel (scope), plus fallback na compact renderer
  const css = `
  /* Scope: pravý panel doporučených */
  ytd-watch-next-secondary-results-renderer .yt-lockup-view-model,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer {
    display: flex !important;
    flex-direction: row !important;
    align-items: center !important;
    gap: 12px !important;
    width: 100% !important;
  }

  /* Thumbnail vlevo – obě varianty hostu */
  ytd-watch-next-secondary-results-renderer .yt-lockup-view-model__content-image,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #thumbnail {
    flex: 0 0 auto !important;
    width: 168px !important;
    min-width: 168px !important;
  }

  /* Obrázek uvnitř hostu (fallback pro různé lazy-load cesty) */
  ytd-watch-next-secondary-results-renderer .ytThumbnailViewModelImage img,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #thumbnail img {
    display: block !important;
    width: 100% !important;
    height: auto !important;
    object-fit: cover !important;
    border-radius: 6px !important;
  }

  /* Textový blok vpravo */
  ytd-watch-next-secondary-results-renderer .yt-lockup-view-model__metadata,
  ytd-watch-next-secondary-results-renderer .yt-lockup-metadata-view-model,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #details {
    flex: 1 1 auto !important;
    min-width: 0 !important;
  }

  /* Stack nadpis + metadata */
  ytd-watch-next-secondary-results-renderer .yt-lockup-metadata-view-model__text-container,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #meta {
    display: flex !important;
    flex-direction: column !important;
    gap: 6px !important;
  }

  /* Nadpis – dvouřádkový clamp */
  ytd-watch-next-secondary-results-renderer .yt-lockup-metadata-view-model__heading-reset,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #video-title {
    margin: 0 !important;
    line-height: 1.33 !important;
    font-size: 0.95rem !important;
    font-weight: 600 !important;
    display: -webkit-box !important;
    -webkit-line-clamp: 2 !important;
    -webkit-box-orient: vertical !important;
    overflow: hidden !important;
  }

  /* Metadata řádky */
  ytd-watch-next-secondary-results-renderer .yt-content-metadata-view-model__metadata-row,
  ytd-watch-next-secondary-results-renderer ytd-compact-video-renderer #metadata {
    display: flex !important;
    flex-wrap: wrap !important;
    gap: 6px !important;
    color: var(--yt-spec-text-secondary, #aaa) !important;
    font-size: 0.85rem !important;
  }

  /* Kompaktní svislé mezery mezi položkami */
  ytd-watch-next-secondary-results-renderer #contents > * {
    margin: 8px 0 !important;
  }

  /* Schovat in-feed reklamy v pravém panelu */
  ytd-watch-next-secondary-results-renderer ytd-ad-slot-renderer,
  ytd-watch-next-secondary-results-renderer ytwSquareImageLayoutViewModelHost,
  ytd-watch-next-secondary-results-renderer ytwFeedAdMetadataViewModelHost,
  ytd-watch-next-secondary-results-renderer ytwAdDetailsLineViewModelHost,
  ytd-watch-next-secondary-results-renderer ad-image-view-model,
  ytd-watch-next-secondary-results-renderer ad-badge-view-model,
  ytd-watch-next-secondary-results-renderer ad-button-view-model {
    display: none !important;
  }
  `;

  try { GM_addStyle(css); } catch (_) {
    const style = document.createElement('style');
    style.textContent = css;
    document.documentElement.appendChild(style);
  }

  // Pomocné: najít pravý panel
  function getSidebarRoot() {
    return document.querySelector('ytd-watch-next-secondary-results-renderer') ||
           document.querySelector('#secondary') || null;
  }

  // Bezpečně horizontálně srovnat jednu kartu (lockup + compact)
  function fixOneCard(el) {
    if (!el) return;

    // Vždy horizontální – YouTube někdy horizontální class nepřidá
    el.classList.add('yt-lockup-view-model--horizontal');

    // Najdi hosty: thumbnail + img
    const thumbHost =
      el.querySelector('.yt-lockup-view-model__content-image') ||
      el.querySelector('#thumbnail');

    // Širší fallback na IMG (lazy-load variace)
    const img =
      (el.querySelector('.ytThumbnailViewModelImage img')) ||
      (thumbHost && thumbHost.querySelector('img'));

    // Pravý textový blok
    const textBox =
      el.querySelector('.yt-lockup-metadata-view-model__text-container') ||
      el.querySelector('#meta') || el.querySelector('#details');

    if (!thumbHost || !textBox) return;

    // Nastavit rozměry a flex chování explicitně
    Object.assign(el.style, { display: 'flex', flexDirection: 'row', alignItems: 'center', gap: '12px' });
    Object.assign(thumbHost.style, { width: '168px', minWidth: '168px', flex: '0 0 auto' });

    if (img) {
      img.style.transition = 'transform 0.25s ease';
      thumbHost.addEventListener('mouseenter', () => { img.style.transform = 'scale(1.03)'; });
      thumbHost.addEventListener('mouseleave', () => { img.style.transform = 'scale(1)'; });
    }

    // Schovat avatar, pokud občas vleze mezi thumbnail a text
    const avatar = el.querySelector('.yt-lockup-metadata-view-model__avatar');
    if (avatar) avatar.style.display = 'none';
  }

  // Schovat reklamy (jen v pravém panelu)
  function hideAds(sidebar) {
    if (!sidebar) return;
    [
      'ytd-ad-slot-renderer',
      'ytwSquareImageLayoutViewModelHost',
      'ytwFeedAdMetadataViewModelHost',
      'ytwAdDetailsLineViewModelHost',
      'ad-image-view-model',
      'ad-badge-view-model',
      'ad-button-view-model',
    ].forEach(sel => sidebar.querySelectorAll(sel).forEach(el => { el.style.display = 'none'; el.remove(); }));
  }

  // Opravit všechny karty v pravém panelu
  function fixAllSidebar() {
    const sidebar = getSidebarRoot();
    if (!sidebar) return;

    hideAds(sidebar);

    // Podpora obou typů „karet“
    const cards = [
      ...sidebar.querySelectorAll('.yt-lockup-view-model'),
      ...sidebar.querySelectorAll('ytd-compact-video-renderer')
    ];
    cards.forEach(fixOneCard);
  }

  // Debounce pro mutace/lazy‑load
  let t;
  const scheduleFix = () => {
    clearTimeout(t);
    t = setTimeout(fixAllSidebar, 150);
  };

  // Observer nad pravým panelem (když existuje), fallback na celý dokument
  const mo = new MutationObserver(scheduleFix);

  function start() {
    scheduleFix();
    const sidebar = getSidebarRoot() || document.documentElement;
    try { mo.observe(sidebar, { childList: true, subtree: true }); } catch (_) { /* no-op */ }
  }

  // Start a jistota pro SPA navigace
  start();
  window.addEventListener('yt-page-data-updated', scheduleFix);
  window.addEventListener('yt-navigate-finish', scheduleFix);
})();
